    state = {
        data: [],
    }


    componentDidMount = () => {
        jsonData.data.map(el => {
            console.log(el.creator.name)
            this.setState({
                users: el.creator.name
            })
        })
    }

    test = () => {
        console.log(this.state.users)
    }

    render () {
        return (
           <div>
               <p>
                   {this.state.data}
               </p>
           </div> 
        )
    }
}

export default TodoList

